var conversions=require("./conversions");var models=Object.keys(conversions);function buildGraph(){var c={};for(var a=models.length,b=0;b<a;b++){c[models[b]]={distance:-1,parent:null}}return c}function deriveBFS(f){var j=buildGraph();var c=[f];j[f].distance=0;while(c.length){var e=c.pop();var h=Object.keys(conversions[e]);for(var d=h.length,b=0;b<d;b++){var g=h[b];var a=j[g];if(a.distance===-1){a.distance=j[e].distance+1;a.parent=e;c.unshift(g)}}}return j}function link(b,a){return function(c){return a(b(c))}}function wrapConversion(d,b){var c=[b[d].parent,d];var a=conversions[b[d].parent][d];var e=b[d].parent;while(b[e].parent){c.unshift(b[e].parent);a=link(conversions[b[e].parent][e],a);e=b[e].parent}a.conversion=c;return a}module.exports=function(c){var f=deriveBFS(c);var e={};var h=Object.keys(f);for(var a=h.length,b=0;b<a;b++){var g=h[b];var d=f[g];if(d.parent===null){continue}e[g]=wrapConversion(g,f)}return e};